const styles = {
  dialogRoot: {
    minWidth: '300px',
    maxWidth: '800px',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingBottom: 10,
    '& h4': {
      margin: 0,
    },
  },
  closeIcon: {
    backgroundColor: '#f9f0f0',
  },
  content: {
    padding: '8px 24px 18px',
    overflow: 'hidden',
  },
  actions: {
    padding: 20,
  },
}

export default styles
